function constructQuery(advancedSearch, andOrAll, query, not) {
	if (advancedSearch) {
		switch (andOrAll) {
			case "and":
				query = query.replace("/ +/", " AND ");
				break;
			case "or":
				query = query.replace("/ +/", " OR ");
				break;
			case "all":
				query = "\"" + query + "\"";
				break;
		}
		if (!(typeof not === "undefined" || not === "" || not === null)) {
			var words = not.split("/ +/");
			words.forEach(function(val, index, arr){
				query += " NOT " + val;
			});
		}
	}
	return query;
}

