function tagContructURL(tags) {
	var ret = "";
	if (Array.isArray(tags)) {
		tags.forEach(function(tag) {
			ret += tag + ",";
		});
		ret = ret.slice(0, -1);
	} else ret = tags;
	return encodeURI(ret);
}

